import React from "react";
import { VictoryPie, VictoryLegend } from "victory";
import "./StylePieChart.css";
import { connect } from "react-redux";

class PieChart extends React.Component {

  render() {
    const {data} = this.props;
    console.table(data);
    return (
        <svg viewBox="20 20 900 900" width="700" height="700">

          <VictoryPie
            standalone={false}
            style={{ labels: { fill: "none"} }}
            innerRadius={100}
            colorScale={["#32aeca", "#8e3ace"]}
            data={data[0]}
            x="name"
            y="number"
          />

          <VictoryLegend
            standalone={false}
            data={data[0]}
            colorScale={["#32aeca", "#8e3ace"]}
            x={400}
            y={200}
          />
          <text x="22" y="50" >Device Types</text>
          <text x="433" y="237" > %</text>
          <text x="615" y="220" ></text>
          <text x="433" y="267" > %</text>
          <text x="615" y="250" >so</text>
        </svg>
    );
  }
}
function mapStateToProps({ data }) {
  return { data };
}

export default connect(mapStateToProps, null)(PieChart);
